INSERT INTO `events` (`eventID`, `title`, `date`, `time`, `location`, `description`) VALUES
(5, 'Beginning of the Semester Meeting', '2021-01-26', '18:00', 'Weir Hall Room 235', 'Join us for the first meeting of 2021! We will be discussing current and future plans, giving an overview of what ACM is, and spending some time getting to know each other. Pizza will be provided on a first come, first served basis.'),
(6, 'ACM Monthly Movie Night', '2021-02-02', '18:00', 'Weir Hall Room 235', 'Come hang out and watch a classic of computer-based cinema, War Games. Starring Matthew Broderick (Also from Ferris Bueller’s Day Off and as the voice of Simba from The Lion King), War Games features a terrible understanding of what computers were capable of in the 80s and some really interesting portrayals of hacking. War Games is considered one of the best films of 1983, and the 80s in general, so come enjoy this classic with us. Popcorn will be provided. '),
(10, 'Invited Talk from Dr. Walter on Genetic Algorithm Solutions for generating computer art', '2021-02-16', '18:00', 'Weir Hall Room 235', 'Dr. Walter will be giving an hour long talk about using genetic algorithms to provide computers with a type of creativity for artistic endeavors. He will provide general information on how to use these algorithms, how to modify them to create art, and how the art created genetically is different from the art that can be created by Neural Networks or general AI applications. Pizza and small art prints will be provided on a first come, first served basis.'),
(11, 'ACM Monthly Movie Night', '2021-03-02', '18:00', 'Weir Hall Room 235', 'Come see Dr. Strangelove (or how I learned to stop worrying and love the bomb), a comedic tale of technology gone wrong in the cold war. This film, directed by Stanley Kubrick, is considered by many to be one of the best films of all time, taking a truly dark topic that, at the time, was the reality for millions and turning it into a surprisingly funny tale about the mistakes that can be made when too much power is given to automation. Popcorn will be provided.'),
(12, 'Game Night', '2021-03-16', '18:00', 'Weir Hall Room 235', 'Come on down for some classic game night fun! Bring a laptop for LAN gaming, enjoy split-screen games on the projector, or play a board game, we have it all! We will have a selection of board games, Super Smash Bros for the Nintendo Switch, and Rock Band 4 to play, but feel free to bring your own systems/games for others to enjoy as well! Snacks will be provided'),
(13, 'ACM Monthly Movie Night', '2021-04-06', '18:00', 'Weir Hall Room 235', 'Who said all movie nights have to be good movies? Come watch one of the craziest films from Dr. Walter’s already crazy collection. Terra Formars is a Japanese movie from the prolific Takashi Miike (who has directed more than 100 films since 1990), based on a manga of the same name. Terra Formars follows a crew of criminals on a mission to Mars, with the goal of discovering if the cockroaches that were sent to terraform have done their jobs. When there, they find that the cockroaches have become bloodthirsty, humanoid monsters that they must fight with “bug DNA” that has been added to their system for the mission. This is a crazy one, so talking during the film is encouraged. Japanese audio with English subtitles. Popcorn will be provided.'),
(14, 'ACM Hackathon', '2020-04-17', '18:00', 'Weir Hall Room 235', 'Get a team of 4 and join us for a 24-hour hackathon! Pit your skills against your friends as you work together to solve a problem we provide. While not required, we recommend you have some understanding of Javascript for this event.  You will be provided dinner, a midnight snack, breakfast, lunch, and plenty of caffeine. Please sign up in advance and include the members you are partnering with. Space is limited.'),
(15, 'ACM Elections and Final Monthly Movie Night of the Year', '2021-05-04', '18:00', 'Weir Hall Room 235', 'Take a break from studying, vote for the next officers of ACM, turn your brain off, and watch a movie! Sure, it is May 4th, but rather than watching Star Wars, we figured it would be more fun to watch a Star Wars knock-off. With that in mind, we will be watching Star Crash, a true classic of Star Wars rip-offs. Popcorn will be provided.');

